**Context**:
1) CSV Headers name: {{19.col_array}}
2) CSV Data set 1 (in the same order as the headers) :{{19.csv_keys_array}}
3) CSV Data set 2 (in the same order as the headers): {{21.text}}
4) Master Sheet Headers: {{19.master_header}}
5) Master Sheet Example Data (in the same order): {{19.master_header_examples}}

**Task**:
1. Analyze the CSV headers and data set 1 and 2 to deduce what each column represents.
2. Analyze the master sheet headers and their example data to understand what each column in the master sheet represents.
3. Map each CSV header to the most relevant master sheet header. If no match is found, map it to "null".
4. Each CSV Header should only occur once as it can only match one Master Sheet header. 

**Expected Output**:
A JSON object with the CSV headers as keys and the matched master sheet headers (or "null") as values. For example:

```json
{
  "csv_header_1": "matching_master_header",
  "csv_header_2": "null",
  "...": "..."
}
